const About = () => (
  <Layout>
    <article className="container-fluid">
      <section className="row">
        <div className="col-lg-6">
          <img src="/photo.png" className="img-fluid"></img>
        </div>
        <div className="col-lg-6 bg-dark"></div>
      </section>
    </article>
  </Layout>
);

export default About;
